import React from 'react';
import Card from './Card';

const Cardlist = ({ robots }) => {
    const cardComponent = robots.map(robofriend => {
        return (
            <Card id={robofriend.id} picture={robofriend.picture} name={robofriend.name} email={robofriend.email} />
        );
    }
    );
    return (
        <div>
        {cardComponent}
        </div>
    )
}

